                    <UploadButton></UploadButton>
                    <LoginButton></LoginButton>
                    <ProfileButton></ProfileButton>
                    {/* <Button>
                        <NavLink href="https://github.com/chiajoukuo/Nmlab_final" >
                            <IoLogoGithub size={25} className="my_page_button"/>
                        </NavLink>
                    </Button> */}
                </div>
            </div>

        );
    }
}

export default Top;
